import React from "react";

class ArtSectionHome extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
        <body className="home-art-body" >
                <h2 className="home-art-head-title">Some Artwork</h2>


            <div className="Home-art-parent">

            </div>






                <button className="home-art-btn">Show More</button>

        </body>


    );
  }
}

export default ArtSectionHome;
